import React from "react";
import Card from './Card';

const StudentCard = (props) => {
    return (
        <>
            {props.students.map(student => (
                <Card 
                    key={student.studentNum} // Add a unique key for each card
                    id={student.studentNum} // Use the student object from the map function
                />
            ))}
        </>
    );
}

export default StudentCard;
